import React, { useState, useEffect } from 'react'

function App() {

  const [data, setData] = useState([{}]);



  useEffect(() => {
    const getData = async () => {
      const response = await fetch("/members");
      const jsonData = await response.json();
      setData(jsonData.members);
    }
    getData();
  }, [])

  const array = data.map((item, i) => {
    <li key={i}>
      {item}
      </li>
  });

  return (
    <div >
      <span>My new app</span>
      <ul>{array ? <span>loading...</span> : array}</ul>
      {console.log("in div:" + array)}
    </div>
  );
}

export default App;
